        const data = {
            labels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun"],
            datasets: [
              {
                label: "First dataset",
                data: [33, 53, 85, 41, 44, 65],
                fill: true,
                backgroundColor: "rgba(75,192,192,0.2)",
                borderColor: "rgba(75,192,192,1)"
              },
              {
                label: "Second dataset",
                data: [33, 25, 35, 51, 54, 76],
                fill: false,
                borderColor: "#742774"
              }
            ]
          };


        return(

            <>



                <h1> Playground page </h1>
                <div className="App">
      <Line data={data}





      />
    </div>








            </>





        )
    }

}



export default (props) => (
    < Playground
        {...props}
        params={useParams()}
    />
);
